    data: |
      SELECT DISTINCT - ( - 6 ) FROM tab2 (FORMAT parquet) cor0 CROSS JOIN tab2 (FORMAT parquet), tab0 (FORMAT parquet) AS cor1;
  - name: tab0
  - name: tab2

outputs:
  - name: q616.out
    data: |
      6
